import React from 'react';
import { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import { Button } from '@mui/material';

function prueba() {

    const cont = 0

    console.log(contador)

    const suma = async (cont) => {
        contador = cont + 1;
        console.log('esta sumando')
        console.log(cont)
    }
    

    

    return(
        <>
            <div>
                <h1>{contador}</h1>
                <Button onClick={() => suma(contador)} sx={{backgroundColor: "red", color: "white"}}> Sumar</Button>
                <Button onClick={() => console.log('restar')} sx={{backgroundColor: "black", color: "white"}}> Restar</Button>
            </div>
        </>
    )
}

export default prueba;
